import time
import unittest

from grains import (
    square,
    total,
)

# Tests adapted from `problem-specifications//canonical-data.json`


class GrainsTest(unittest.TestCase):
    def test_grains_on_square_1(self):
        self.assertEqual(square(1), 1)

    def test_grains_on_square_2(self):
        self.assertEqual(square(2), 2)

    def test_grains_on_square_3(self):
        self.assertEqual(square(3), 4)

    def test_grains_on_square_4(self):
        self.assertEqual(square(4), 8)

    def test_grains_on_square_16(self):
        self.assertEqual(square(16), 32768)

    def test_grains_on_square_32(self):
        self.assertEqual(square(32), 2147483648)

    def test_grains_on_square_64(self):
        self.assertEqual(square(64), 9223372036854775808)

    def test_square_0_raises_an_exception(self):
        with self.assertRaises(ValueError) as err:
            square(0)
        self.assertEqual(type(err.exception), ValueError)
        self.assertEqual(err.exception.args[0], "square must be between 1 and 64")

    def test_negative_square_raises_an_exception(self):
        with self.assertRaises(ValueError) as err:
            square(-1)
        self.assertEqual(type(err.exception), ValueError)
        self.assertEqual(err.exception.args[0], "square must be between 1 and 64")

    def test_square_greater_than_64_raises_an_exception(self):
        with self.assertRaises(ValueError) as err:
            square(65)
        self.assertEqual(type(err.exception), ValueError)
        self.assertEqual(err.exception.args[0], "square must be between 1 and 64")

    def test_returns_the_total_number_of_grains_on_the_board(self):
        self.assertEqual(total(), 18446744073709551615)

    def test_returns_the_total_number_of_grains_on_the_performance_board(self):
        start_time = time.time()
        self.assertEqual(total(64), 18446744073709551615)
        print(f"64 squares took: {time.time() - start_time} seconds")
        start_time = time.time()
        self.assertEqual(total(128), 340282366920938463463374607431768211455)
        print(f"128 squares took: {time.time() - start_time} seconds")
        start_time = time.time()
        self.assertEqual(total(256), 115792089237316195423570985008687907853269984665640564039457584007913129639935)
        print(f"256 squares took: {time.time() - start_time} seconds")
        start_time = time.time()
        self.assertEqual(total(512), 13407807929942597099574024998205846127479365820592393377723561443721764030073546976801874298166903427690031858186486050853753882811946569946433649006084095)
        print(f"512 squares took: {time.time() - start_time} seconds")
        start_time = time.time()
        self.assertEqual(total(1024), )
        print(f"1024 squares took: {time.time() - start_time} seconds")
        start_time = time.time()
        self.assertEqual(total(65536), )
        print(f"65536 squares took: {time.time() - start_time} seconds")
        start_time = time.time()
        self.assertEqual(total(131072), )
        print(f"131072 squares took: {time.time() - start_time} seconds")
        start_time = time.time()
        self.assertEqual(total(262144), )
        print(f"262144 squares took: {time.time() - start_time} seconds")
